import React from 'react';

const Navbar =()=> {
    return (
        <nav className='nav'>
            <div>
                <a href={'#'}>Profile</a>
            </div>

            <div>
                <a href={'#'}>Message</a>
            </div>

            <div>
                <a href={'#'}>News</a>
            </div>

            <div>
                <a href={'#'}>Music</a>
            </div>

            <div>
                <a href={'#'}>Setting</a>
            </div>

        </nav>
    )
};

export default Navbar();
